/**
*Suppose LeetCode will start its IPO soon. In order to sell a good price of its shares to Venture Capital, LeetCode would like to work on some projects to increase its capital before the IPO. Since it has limited resources, it can only finish at most k distinct projects before the IPO. Help LeetCode design the best way to maximize its total capital after finishing at most k distinct projects.

You are given n projects where the ith project has a pure profit profits[i] and a minimum capital of capital[i] is needed to start it.

Initially, you have w capital. When you finish a project, you will obtain its pure profit and the profit will be added to your total capital.

Pick a list of at most k distinct projects from given projects to maximize your final capital, and return the final maximized capital.

The answer is guaranteed to fit in a 32-bit signed integer.

 

Example 1:

Input: k = 2, w = 0, profits = [1,2,3], capital = [0,1,1]
Output: 4
Explanation: Since your initial capital is 0, you can only start the project indexed 0.
After finishing it you will obtain profit 1 and your capital becomes 1.
With capital 1, you can either start the project indexed 1 or the project indexed 2.
Since you can choose at most 2 projects, you need to finish the project indexed 2 to get the maximum capital.
Therefore, output the final maximized capital, which is 0 + 1 + 3 = 4.
Example 2:

Input: k = 3, w = 0, profits = [1,2,3], capital = [0,1,2]
Output: 6
*/

// Working but timeout

interface project {
  id: number;
  cost: number;
  profit: number;
}

function bestCapitalProfit(w: number, projects: Map<number, project[]>, usedProjects: Map<number, void>): project | undefined {
  for (const pro_arr of projects.values()) {
    for (const proj of pro_arr) {
      if (proj.cost <= w && !usedProjects.has(proj.id)) {
        // console.log(`bestProject with ${w}:`, proj);
        usedProjects.set(proj.id);
        return proj;
      }
    }
  }
  return undefined;
}

function findMaximizedCapital(k: number, w: number, profits: number[], capital: number[]): number {
  // Store already  used projects
  const usedProjects = new Map<number, void>;
  // Build bestMargin array
  const projects = new Map<number, project[]>();
  for (let index = 0; index < profits.length; index++) {
    let curr_project: project = {
      id: index,
      profit: profits[index],
      cost: capital[index],
    };
    const arr = projects.get(curr_project.profit) ?? [];
    arr.push(curr_project);
    projects.set(curr_project.profit, arr)
  }
  // Sort each profit key by cost
  projects.forEach((arr) => { arr.sort((a, b) => a.cost - b.cost) })
  const sortedByKey = new Map([...projects.entries()].sort(([a], [b]) => b - a));
  // console.log(sortedByKey)

  // Iterate over k possibility to increase total capital before IPO
  for (let projectIndex = 0; projectIndex < k; projectIndex++) {
    // Find best capital-profit project
    const best = bestCapitalProfit(w, sortedByKey, usedProjects)
    // console.log(best)
    if (best == undefined) { break; }
    w = w + best.profit;
  }
  return w;
};

function test(k: number, w: number, profits: number[], capital: number[], expected: number) {
  console.log('='.repeat(50))
  console.log('k:', k, 'w:', w, 'profits:', profits, 'capital', capital)
  console.log('result:', findMaximizedCapital(k, w, profits, capital));
  console.log('expected:', expected)
}

